import './App.css';
import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path="/" element={<div>Главная страница</div>} />
      <Route path="/user" element={<div>Страница пользователя</div>} />
    </Routes>
  );
}

export default App;
